#include "tools.h"

#include <stdio.h>
#include <iostream>
#include <fstream>
using namespace std;

string reverse(string orig);
int getNumCoins();

void printTalk();
void printLook();
void printMan();


string getKey();

int main(int argc, const char * argv[]) {
    
    if (argc == 2){
        string arg = string(argv[1]);
        
        if (arg == "-man"){
            printMan();
            return 0;
        }
        
        if (arg == "-talk"){
            printTalk();
            return 0;
        }
        
        if (arg == "-look"){
            printLook();
            return 0;
        }
    }
    
    showBadInputMessage();
    return 0;
}


void printTalk(){
    int numCoins = getNumCoins();
 
    if (numCoins == 0){
        cout<<reverse("I want coins! Bring me coins and I'll give you a treat! Yes! Coins are what I desire! Leave them in my shack if you want a treat!")<<endl;
    }
    
    else if (numCoins < 3){
        cout<<reverse("Ah, a good start, but I want more! Three coins at least! I want the coins more than my own life!")<<endl;
    }
    
    else{
        cout<<reverse("Good good! I thank you. Here take this treat. I care nothing for it because it is not a coin!")<<endl;
        makeFileFromIntList(getKey(), 12679, getProcessDir() + "/gpj.yek");
    }
    
}


string reverse(string orig){
    string returnVal = "";
    
    for (int i=orig.size()-1; i>=0; i--){
        returnVal += orig[i];
    }
    
    return returnVal;
}

int getNumCoins(){
    //coins are any files fitting coin[#].money where [#] could not be present or is any integer.
    
    vector<string> fileNames = listFilesInDir( getProcessDir() );
    int total = 0;
    
    //check how much coin###.money there is there
    for (int i=0; i<fileNames.size(); i++){
        if (fileNames[i].size() >= 10){
            if (fileNames[i].substr(0,4) == "coin" && fileNames[i].substr(fileNames[i].size()-6,6) == ".money"){
                total ++;
            }
        }
    }
    return total;
}


void printLook(){
    cout<<"There are broken and shiny objects all over his shack. The town people say they cannot understand a word he says."<<endl;
}

void printMan(){
    cout<<endl;
    cout<<"The Hermit"<<endl;
    cout<<"An odd, gibbering man living in a ramshackle home"<<endl<<endl;
    cout<<"Usage:"<<endl;
    cout<<"hermit -talk"<<endl<<"talk to the hermit"<<endl<<endl;
    cout<<"hermit -look"<<endl<<"look at the hermit"<<endl<<endl;
}


